import { render } from '@testing-library/react';
import React from 'react';
import {Image, Button, Icon, Label, Divider, Grid, Header} from 'semantic-ui-react';
import Comments from './comment.js';
import Buttons from "./buttons.js";

import sw from "./sw.jpeg";



function App() {
  return (
    <div>
      <Grid centered>
        <Grid.Row>
          <Image src = {sw} centered />
        </Grid.Row>
        <Grid.Row>
        <Buttons/>
        </Grid.Row>
      </Grid>
    <br/>

    <Divider horizontal>
      <Header as = "h4">
        <Icon name = "comment alternate" style = {{color: "white"}}/>
        후기를 남겨주세요
      </Header>
    </Divider>
    <Comments/>

    </div>
)}

export default App;
